import{_ as t,o as e,c as o,f as n}from"./app-2e9cf0b8.js";const r="/assets/img/activity/GOTC-2023-1.jpg",a="/assets/img/activity/GOTC-2023-2.png",s="/assets/img/activity/GOTC-2023-3.jpg",i={},p=n('<p>全球开源技术峰会（Global Open-source Technology Conference） GOTC 2023  由开放原子开源基金会、 上海浦东软件园、Linux 基金会亚太区和开源中国联合发起， 将于  <strong>5 月 27 日至 28 日在上海张江科学会堂隆重举行，Dromara 开源社区将出席本次大会。</strong></p><p>为期 2 天的开源行业盛会，将以行业展览、主题发言、论坛、圆桌、快闪演讲、开源市集等形式来诠释此次大会主题 ——“Open Source, Into the Future”。与会者将一起探讨元宇宙、安全、3D 引擎、eBPF、Web3.0、区块链等热门技术主题，以及开源治理、汽车软件、AIGC、AI 编程、开源教育培训、云原生等热门话题，探讨开源未来，助力开源发展。大会主论坛将邀请国内外多位重磅嘉宾发表致辞、主题演讲，并设置两大圆桌讨论，从多个角度探讨开源与各项技术、各个行业的结合与落地实践，探讨未来可能的发展方向。敬请关注！</p><p>大会报名通道：https://www.bagevent.com/event/8387611</p><p>大会官网： https://gotc.oschina.net</p><p><img src="'+r+'" alt=""><strong>GOTC 2023 由一个主论坛、十余个分论坛组成。</strong></p><p>本次大会将邀请 LF AI &amp; Data 基金会执行董事、PyTorch 基金会执行董事 Ibrahim Haddad、OpenSSF 总经理 Brian Behlendorf、Open 3D 基金会执行董事 Royal O&#39;Brien、Hyperledger 基金会执行董事 Daniela Barbosa，以及来自百度、华为、腾讯、火山引擎、红帽、Intel、VMWare、F5、微软、开源中国等企业的全球开源重磅嘉宾出席，为开发者、为行业分享开源的观点、经验借鉴与未来探索。</p><p>● <strong>开源市集</strong></p><p>在大会展厅，三十多家开源技术社区将以创意摆摊的方式，打造一场身临其境的沉浸式市集体验，展示开源项目、周边商品，交流开源技术、开源理念、开放协作方式。<strong>Dromara</strong> <strong>开源社区将在开源集市展位等待大家，我们给大家准备精美礼品~ Hutool 阿超，LiteFlow 铂赛东，Forest 子骏，DataCompare 子房等众多大佬等你线下网友面基</strong></p><p>张江科学会堂</p><figure><img src="'+a+'" alt="" tabindex="0"><figcaption></figcaption></figure><figure><img src="'+s+'" alt="" tabindex="0"><figcaption></figcaption></figure>',11),c=[p];function g(l,_){return e(),o("div",null,c)}const f=t(i,[["render",g],["__file","GOTC-2023.html.vue"]]);export{f as default};
